  static belongsTo<T extends ActiveRecord$Base = any>(
    relationName: string,
    klass: Function,
    foreignKey: string
  ) {
    Registry.create(this.name, Association.belongsTo, {
      [relationName]: (self: T) => (klass as any).findBy({ primaryKey: self[foreignKey] }),
    });
