      return { [klassNameLeft]: this.primaryKey, [klassNameRight]: record.primaryKey };
    } else {
      throw errObj({
        code: ErrCodes.RECORD_DO_NOT_HAVE_HAS_AND_BELONGS_TO_MANY,
