        } else {
          leavedData.push(record);
        }
      } else {
        deleteData.push(record);
      }
    });
    RecordCache.update(klassName, ActiveRecord$Persistence.RECORD_ALL, leavedData);

    deleteData.forEach((record) => Object.freeze(record));
    return deleteData;
